$color-primary: #05d686;

// COMMON
@import url('https://fonts.googleapis.com/css2?family=Noto+Sans&display=swap');

* {
  margin: 0 auto;
  padding: 0;
  box-sizing: border-box;
  text-decoration: none;
  list-style: none;
  color: #333;
}

body {
  font-family: 'Noto Sans', sans-serif;
  font-size: 1rem;
  position: relative;

  img {
    width: 100px;
  }

  button,
  img {
    cursor: pointer;
  }

  h1 {
    font-size: 4rem;
    line-height: 6rem;
  }

  h2 {
    font-size: 3rem;
  }

  h3 {
    font-size: 2rem;
    line-height: 1.8rem;
  }

  h4 {
    font-size: 1.5rem;
    line-height: 1.5rem;
  }

  h5 {
    font-size: 1.2rem;
    line-height: 1rem;
  }

  h6 {
    font-size: 1rem;
    line-height: 1.2;
  }

  span {
    font-size: 1rem;
  }

  .btn-primary {
    padding: 0.5rem 1rem;
    background-color: transparent;
    border: 1px solid #fff;
    border-radius: 20px;
    color: #fff;
    transition: 0.8s;

    &:hover {
      background-color: $color-primary;
      border: 1px solid $color-primary;
    }
  }

  .btn-black {
    padding: 0.5rem 1rem;
    background-color: transparent;
    border: 1px solid #333;
    border-radius: 20px;
    transition: 0.8s;

    &:hover {
      background-color: $color-primary;
      border: 1px solid $color-primary;
      color: #fff;
    }
  }

  .btn-primary-wh {
    padding: 0.5rem 1rem;
    background-color: transparent;
    border: 1px solid #fff;
    border-radius: 20px;
    color: #fff;
    transition: 0.8s;

    &:hover {
      background-color: #fff;
      border: 1px solid #fff;
      color: #333;
    }
  }

  .btn-arrow {
    width: 120px;
    color: #bbb;
    margin-top: 1rem;
    display: flex;
    align-items: center;
    transition: 0.8s;
    cursor: pointer;

    i {
      color: #bbb;
      font-size: 1.5rem;
      margin-left: 0.3rem;
      transition: 0.8s;
    }

    &:hover i {
      color: $color-primary;
      margin-left: 1rem;
    }
  }
}

// HEADER
header {
  nav {
    height: 5rem;
    width: 100vw;
    background-color: #131418;
    box-shadow: 0 3px 20px #131418;
    display: flex;
    position: fixed;
    z-index: 10;
  }

  .logo {
    padding: 1vh 1vw;
    text-align: center;
  }

  .logo img {
    width: 100px;
    margin: 1rem;
  }

  .nav-links {
    display: flex;
    list-style: none;
    width: 88vw;
    padding: 0 0.7vw;
    justify-content: space-evenly;
    align-items: center;
    text-transform: uppercase;
  }

  .nav-links li a {
    text-decoration: none;
    margin: 0 0.7vw;
    color: #fff;
  }

  .nav-links li a:hover {
    color: $color-primary;
  }

  .nav-links li {
    position: relative;
  }

  .nav-links li a::before {
    content: "";
    display: block;
    height: 3px;
    width: 0%;
    background-color: $color-primary;
    position: absolute;
    top: -1rem;
    transition: all ease-in-out 250ms;
    margin: 0 0 0 10%;
  }

  .nav-links li a:hover::before {
    width: 80%;
  }

  .login-button {
    background-color: transparent;
    border: 1.5px solid #fff;
    color: #fff;
    border-radius: 2em;
    padding: 0.6rem 0.8rem;
    margin-left: 2vw;
    font-size: 1rem;
    cursor: pointer;

  }

  .login-button:hover {
    color: rgba(0, 0, 0, .8);
    background-color: #fff;
    border: 1.5px solid #fff;
    transition: all ease-in-out 350ms;
  }

  .join-button {
    color: #131418;
    background-color: $color-primary;
    border: 1.5px solid $color-primary;
    border-radius: 2em;
    padding: 0.6rem 0.8rem;
    font-size: 1rem;
    cursor: pointer;
  }

  .join-button:hover {
    color: #fff;
    background-color: transparent;
    border: 1.5px solid #fff;
    transition: all ease-in-out 350ms;
  }

  .hamburger div {
    width: 30px;
    height: 3px;
    background: #fff;
    margin: 5px;
    transition: all 0.3s ease;
  }

  .hamburger {
    display: none;
  }

  @media screen and (max-width: 800px) {
    nav {
      position: fixed;
      z-index: 100;
    }

    .hamburger {
      display: block;
      position: absolute;
      cursor: pointer;
      right: 1rem;
      top: 50%;
      transform: translate(-5%, -50%);
      z-index: 2;
      transition: all 0.7s ease;
    }

    .nav-links {
      position: fixed;
      background: #000;
      height: 100vh;
      width: 100%;
      flex-direction: column;
      clip-path: circle(50px at 90% -20%);
      -webkit-clip-path: circle(50px at 90% -10%);
      transition: all 1s ease-out;
      pointer-events: none;
    }

    .nav-links.open {
      clip-path: circle(1000px at 90% -10%);
      -webkit-clip-path: circle(1000px at 90% -10%);
      pointer-events: all;
    }

    .nav-links li {
      opacity: 0;

      a,
      button {
        color: #fff;
      }
    }

    .nav-links li:nth-child(1) {
      transition: all 0.5s ease 0.2s;
    }

    .nav-links li:nth-child(2) {
      transition: all 0.5s ease 0.4s;
    }

    .nav-links li:nth-child(3) {
      transition: all 0.5s ease 0.6s;
    }

    .nav-links li:nth-child(4) {
      transition: all 0.5s ease 0.7s;
    }

    .nav-links li:nth-child(5) {
      transition: all 0.5s ease 0.8s;
    }

    .nav-links li:nth-child(6) {
      transition: all 0.5s ease 0.9s;
      margin: 0;
    }

    .nav-links li:nth-child(7) {
      transition: all 0.5s ease 1s;
      margin: 0;
    }

    li.fade {
      opacity: 1;
    }
  }

  .toggle .line1 {
    transform: rotate(-45deg) translate(-5px, 6px);
  }

  .toggle .line2 {
    transition: all 0.7s ease;
    width: 0;
  }

  .toggle .line3 {
    transform: rotate(45deg) translate(-5px, -6px);
  }
}

